import React from 'react';

const Blog = () => (
  <div className="container mt-4">
    <h1>Blog Page</h1>
    <p className="lead">Explore our latest posts below:</p>
    <ul className="list-group">
      <li className="list-group-item">Post 1: How to Start a Blog</li>
      <li className="list-group-item">Post 2: Tips for Writing Engaging Content</li>
      <li className="list-group-item">Post 3: SEO Basics for Bloggers</li>
    </ul>
  </div>
);

export default Blog;
